#!/usr/bin/env python

from greengenes.b3 import check_chimera, parse_bel3_result, \
        fractionate_sequence, pick_parents
from cogent.util.unit_test import TestCase, main
from cogent.parse.fasta import MinimalFastaParser
from StringIO import StringIO
import os

class B3Tests(TestCase):
    def setUp(self):
        self.refseqs = dict(MinimalFastaParser(StringIO(refseqs)))
        self.chimera_id, self.chimera_seq = \
            list(MinimalFastaParser(StringIO(chimera_target)))[0]
        self.nonchimera_id = 'p__Thermi'
        self.nonchimera_seq = self.refseqs['p__Thermi']

    def test_pick_parents(self):
        """pick the best parenst for your sequence"""
        db = os.path.join(os.getcwd(), 'test_db.fasta')
        exp = [({'NZ_GG739926_647533195':\
                    ref_parents['NZ_GG739926_647533195'],
               'NZ_GG770509_647533119':\
                    ref_parents['NZ_GG770509_647533119']},
                    'chim', chimera[0][1])]
        obs = list(pick_parents(db, ref_parents, chimera, 1))

        self.assertEqual(obs, exp)

    def test_fractionate_sequence(self):
        """split up a sequence"""
        seq = "AAAATTTTGGGGCCCC"
        exp = ['AAAA','TTTT','GGGG','CCCC']
        obs = fractionate_sequence(seq)
        self.assertEqual(obs,exp)

        seq = "AAAATTTTGGGGCCCCA"
        exp = ['AAAAT','TTTGG','GGCCC','CA']
        obs = fractionate_sequence(seq)
        self.assertEqual(obs,exp)

    def test_check_chimera(self):
        """see if we've got a chimera!"""
        obs_chimera = check_chimera(self.refseqs, self.chimera_id, 
                                    self.chimera_seq)
        exp_chimera = 1.10771
        self.assertEqual(obs_chimera, exp_chimera)

        del self.refseqs[self.nonchimera_id]
        exp_non_chimera = None
        obs_non_chimera = check_chimera(self.refseqs, self.nonchimera_id,
                                        self.nonchimera_seq)
        self.assertEqual(obs_non_chimera, exp_non_chimera)

    def test_parse_bel3_result(self):
        """parse bel3 output"""
        exp_non_chimera = None
        obs_non_chimera = parse_bel3_result(StringIO(non_chimera_out))
        self.assertEqual(obs_non_chimera, exp_non_chimera)

        exp_chimera = 1.10771
        obs_chimera = parse_bel3_result(StringIO(chimera_out))
        self.assertEqual(obs_chimera, exp_chimera)

